import React, { Component } from 'react';

const EntryHeader = () => {
    return <h3>Title</h3>;
}

const EntryBody = props => {
    const lines = props.entryData.map((line, index) =>{
        return (
            <div>
                <h2>{line.title}</h2>
                <p>{line.body}</p>
            </div>
        )
    })
    return (
        <div>
            {lines}
        </div>
    )
}

class Entries extends Component {
    render() {
        const { entryData } = this.props
        return (
            <div>
                <h2>My Entries</h2>
                <EntryHeader />
                <EntryBody entryData={entryData}/>
            </div>
        )
    }
}

export default Entries;
